import React, { useEffect } from "react";

class WebGazer {
  constructor() {
    // Setting up connection to ROSbridge
    useEffect(() => {
        this.webgazer = window.webgazer
        // this.webgazer.setGazeListener((data, clock) => {
        //   console.log(data, clock);
        // }).begin();
      }, []);
  }

  detect() {
    useEffect(() => {
        this.webgazer.setGazeListener((data, clock) => {
          console.log(data, clock);
        }).begin();
      }, []);
  }
}

export default WebGazer;
